import React from 'react';
import './Navigation.css'
const Navigation = () => {
    return (
        <div>
            <header className="bg-white black-80 tc pv4 avenir">
                <h1 className="mt2 mb0 baskerville i fw1 f1">Smart Brain</h1>
                <nav className="brt brb tc mw7  mt4" style={{justifyContent:'flex-end',display:'flex'}}>
                    <a className="f3 f5-l link bg-animate black-80  dim underline dib pointer pa3 ph4-l" href="/">Home</a>
                    <a className="f3 f5-l link bg-animate black-80  dib pa3 ph4-l" href="/portfolio">Portfolio</a>
                    <a className="f3 f5-l link bg-animate black-80  dib pa3 ph4-l" href="/shop">Shop</a>
                    <a className="f3 f5-l link bg-animate black-80  dib pa3 ph4-l" href="/about">About</a>
                    <a className="f3 f5-l link bg-animate black-80  dib pa3 ph4-l" href="/contact">Contact</a>
                </nav>

            </header>

        </div>
    );

}

export default Navigation;
